window.bookSummaryJSON = "<p>Nicole Lee's life is going nowhere. No family, no money, and stuck in a relationship with a thug named Bungie. But, after one of Bungie's \"deals\" goes south, he and Nicole are whisked away by a mysterious moth-like humanoid to a strange ship called the Fyrantha. </p> <p>Once aboard, life on the ship seems too good to be true. All she has to do is work on one of the ship's many maintenance crews. However, she learned long ago that nothing comes without a catch. When she's told to keep quiet and stop asking questions, she knows she is on to something. </p> <p>Nicole soon discovers that many different factions are vying for control of the Fyrantha, and she and her friends are merely pawns in a game beyond their control. But, she is tired of being used, and now Nicole is going to fight. </p>"; 
